val ps_raw = sc.wholeTextFiles(fs+"host-data/metrics/ps/*")
case class Process(node: String, ts: Long, user: String, pid: String, CPU: Double, Mem: Double, VSZ: Int, RSS: Int, TTY: String, STAT: String, Start: String, Time: String, Command: String)

//Take the timestamp from filename and prepend it to each row of "ps" output
ps_raw.flatMap(x => {
  val node = x._1.split("/")(x._1.split("/").size - 2)
  val ts = x._1.split("/").last
  x._2.split("\n").drop(1).map(node + " " + ts + " " + _)
}).map(y => { 
  val x = y.split("\\s+")
  Process(
    x(0), x(1).toLong/1000, x(2), x(3), x(4).toDouble, x(5).toDouble, x(6).toInt, x(7).toInt, x(8), x(9), x(10), x(11), x.slice(12, x.size-1).mkString(" ")
  )
}).toDF().coalesce(1).createOrReplaceTempView("ps_raw")

